import React, { Component } from 'react';
import './contact.css';

class Contact extends Component {
    constructor(props){
        super(props);
        this.handleImageHover = this.handleImageHover.bind(this);
        this.state = {didHover: false}
    }

    handleImageHover() {
            this.setState(state => ({
            visibility: !state.visibility,
        }));
    }


    showFullContact() {
        return (
            <div>
                <h3 className='contact-name contact-item'>{this.props.name}</h3>
                <a className='contact-item' href={this.props.link}>{this.props.content}</a>
            </div>
        );
    }

    render() {
        return (
            <div className='contact'>
                <img onMouseEnter={this.handleImageHover} src={this.props.src} alt='img' height='42' width='42'/>
                <this.showFullContact/>
            </div>
        );
    }
}

export default Contact;
